### Summary of Core Topics, Concepts, Principles, and Equations

The exam focuses on various aspects of English language and grammar. Here are the core topics, concepts, and principles that are essential to study:

#### 1. **Discourse Markers**
- **Definition**: Words or phrases that help to connect ideas and maintain the flow of speech or writing.
- **Examples**: Firstly, Secondly, Consequently, Finally, I mean, etc.
- **Usage**: To add information, confirm clarity, express something not good, etc.

#### 2. **Adjectival Clauses**
- **Definition**: A dependent clause that functions as an adjective to modify a noun.
- **Example**: "She wore a beautiful dress, which she had bought on her trip to Paris."
  - Adjectival clause: "which she had bought on her trip to Paris"
  - Noun modified: "dress"

#### 3. **Suffixes and Verb Tenses**
- **Suffix -ing**: Indicates the progression of an action in present time.
  - Example: "He is staring at the world as if he has never seen it before."

#### 4. **Complements in Sentences**
- **Definition**: Words or phrases that complete the meaning of a sentence.
- **Example**: "They gave him an award."
  - Complements: "him" and "an award"

#### 5. **Adjectives**
- **Types**: Predicative, Attributive, Indicative, Adverbial.
- **Example**: "The scariest villain I have seen comes in that novel."
  - Adjective: "scariest" (Attributive)

#### 6. **Adverbs**
- **Definition**: Words that modify verbs, adjectives, or other adverbs.
- **Types**: Focus, Comment, Viewpoint.
- **Example**: "Technically speaking, the upcoming nuclear treatment plant will certainly invite only criticisms."
  - Adverbs: "Technically," "certainly"

#### 7. **Intonation**
- **Definition**: The rise and fall of the voice in speaking.
- **Types**: Rising, Flat, Falling.
- **Example**: "The sun rises in the east." (Flat intonation)

#### 8. **Figures of Speech**
- **Examples**: Hyperbole, Synecdoche, Litotes, Euphemism, Simile, Paradox, Oxymoron, Pun, Personification.
- **Example**: "Free as a bird." (Simile)

#### 9. **Sentence Structure**
- **Types**: Simple, Compound, Complex.
- **Example**: "I went to the store, but I forgot to buy milk." (Compound)

#### 10. **Clauses**
- **Types**: Independent, Dependent, Adverbial, Relative.
- **Example**: "The kid who lives next door is very interesting."
  - Relative pronoun: "who"

#### 11. **Adverb Phrases**
- **Definition**: A group of words that function as an adverb.
- **Example**: "The other clerk, whose name I have now forgotten, nodded and apologized while chewing on a pink lobe of kola nut."
  - Adverb phrase: "while chewing on a pink lobe of kola nut"

